import React, { useState, useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import "./Home.css";

function Home() {
  const slides = [
    "/images/food-donation.jpg",
    "/images/education.jpg",
    "/images/children-smile.jpg",
    "/images/medical-help.jpg",
  ];

  const [current, setCurrent] = useState(0);

  // üîπ Initialize slideshow
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrent((prev) => (prev + 1) % slides.length);
    }, 5000);
    return () => clearInterval(interval);
  }, [slides.length]);

  // üîπ Initialize AOS
  useEffect(() => {
    AOS.init({
      duration: 1200,
      once: true,
      offset: 100,
    });
  }, []);

  return (
    <div className="home-container">
      {/* üîù Header */}
      <header className="home-header" data-aos="fade-down">
        <div className="logo">
          <h2>üåç NGOCONNECT</h2>
        </div>
        <div className="header-buttons">
          <button onClick={() => (window.location.href = "/about")}>About Us</button>
          <button onClick={() => (window.location.href = "/login")}>Login</button>
          <button onClick={() => (window.location.href = "/register")}>Register</button>
        </div>
      </header>

      {/* üñºÔ∏è Background Slideshow */}
      <div className="slideshow">
        {slides.map((slide, index) => (
          <img
            key={index}
            src={slide}
            alt={`slide-${index}`}
            className={`slide ${index === current ? "active" : ""}`}
            data-aos="zoom-in"
          />
        ))}
      </div>

      {/* ‚ú® Hero Section */}
      <div className="home-content" data-aos="fade-up">
        <h1>Bringing Hope. Inspiring Change.</h1>
        <p>Join hands with NGOCONNECT to make a difference in someone‚Äôs life.</p>

        <div className="home-buttons" data-aos="zoom-in-up">
          <button onClick={() => (window.location.href = "/donate-options")}>
            üíñ Donate Now
          </button>
          <button onClick={() => (window.location.href = "/activities")}>
            üåç Our Activities
          </button>
        </div>
      </div>

      {/* ‚ù§Ô∏è Donate & Support Section */}
      <section className="donate-support" data-aos="fade-up">
        <h2 data-aos="fade-right">Donate & Support</h2>
        <p data-aos="fade-left">Your small contribution can create a big impact.</p>

        <div className="donate-grid">
          <div
            className="donate-card"
            onClick={() => (window.location.href = "/food-donation")}
            data-aos="flip-left"
          >
            <img src="/images/food-donation.jpg" alt="Food Donation" />
            <h3>üç≤ Food Donation</h3>
          </div>

          <div
            className="donate-card"
            onClick={() => (window.location.href = "/book-donation")}
            data-aos="flip-right"
          >
            <img src="/images/education.jpg" alt="Book Donation" />
            <h3>üìö Book Donation</h3>
          </div>

          <div
            className="donate-card"
            onClick={() => (window.location.href = "/cloth-donation")}
            data-aos="flip-left"
          >
            <img src="/images/children-smile.jpg" alt="Cloth Donation" />
            <h3>üëï Cloth Donation</h3>
          </div>

          <div
            className="donate-card"
            onClick={() => (window.location.href = "/medical-support")}
            data-aos="flip-right"
          >
            <img src="/images/medical-help.jpg" alt="Medical Support" />
            <h3>üíä Medical Support</h3>
          </div>
        </div>
      </section>
    </div>
  );
}

export default Home;
